import React from 'react';
import logo from './logo.svg';
import './App.css';

function App(props) {
	return (
		<div className="main">
			<header className="menu">
				<img src={logo} className="App-logo" alt="logo" />
				<Menu name={this.props}/>
			</header>
		</div>
	);
}

export default App;
